import React from 'react';
import "./Footer.css";

function Footer(){
  return(
    <footer class="footer mt-auto py-3">
      <div class="container">
        <span class="text-muted">Place sticky footer content here.</span>
      </div>
    </footer>
  );
}

export default Footer;
